exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`http://www.wksw.la/files/article/html/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/class="book-list"/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};